import { useState } from "react";
import filename from "./fileicon.png"

function App() {

  const [file, setfile] = useState("")

    function upload(){

      var data = {
        value : file
      }

      fetch("http://localhost:3001/sendData", {
        method : 'post',
        headers : {
          "Content-Type": "application/json",
        },
        body : JSON.stringify(data),
      });
    }

  return (
    <div className='file'>
      <p>Upload file</p>
      <label className='box'htmlFor="upload">
      <img src={filename} alt=""/>
        <input type='file' id='upload' size={500} hidden onChange={(e)=> setfile(e.target.files[0].name)}/>
        <p className="one">Drop your file or image</p>
        <p className="two">Maximum  file size 500 MP</p>
      </label>
      <button onClick={()=> upload()}>Upload</button>      
      <div className='output'>{file}</div>
    </div>
  );
}

export default App;
